import './App.css';
import Banner from './Components/Banner/Banner';
import Navbar from './Components/Navbar/Navbar';
import Card from './Components/Card/Card';
function App() {
  return (
    <div className="App">
      <Navbar/>
      <Banner/>
      <h2 className='movie'>Movies</h2>
      <Card/>
    </div>
  );
}

export default App;
